package d2;
import java.util.Scanner;
public class A2switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a;
		a = 1;
		
		switch (a) {
			case 1:
				System.out.println("one!");
				break;
			case 2:
				System.out.println("Two!");
				break;
			default:
				System.out.println("Except 1,2");
				break;
		}
	}
}
